import React from "react";
import axios from "axios";

export default class AnimalList extends React.Component{
    state = {
        Search:[]
    }
    componentDidMount(){
        axios.get(`http://omdbapi.com/?apikey=b864d43e&s=titanic`)
        .then(res=>{
            const animals = res.data;
            this.setState({animals});
        }) 
    }
}
